import React from 'react';


const Home = () => {
return (
	<div
	style={{
		display: 'flex',
		justifyContent: 'Left',
		alignItems: 'Left',
		height: '100vh'
	}}
	>
	<body>
	<h2>Definitions</h2>

	<p><span style={{fontWeight: 'bold'}}>Open stock price: </span> first price a stock trades at when the market opens</p>
	<p><span style={{fontWeight: 'bold'}}>High stock price: </span>  more people want to buy a stock than sell it, supply is lower than demand</p>
	<p><span style={{fontWeight: 'bold'}}>Low stock price: </span> more people want to sell a stock than buy it, supply is greater than demand</p>
	<p><span style={{fontWeight: 'bold'}}>Close stock price: </span>  last price a stock trades at when the market closes</p>
	<h2>Visualizations</h2>
	<iframe src='https://flo.uri.sh/visualisation/12127894/embed' title='Interactive or visual content' class='flourish-embed-iframe' frameborder='0' scrolling='no' style='width:100%;height:600px;' sandbox='allow-same-origin allow-forms allow-scripts allow-downloads allow-popups allow-popups-to-escape-sandbox allow-top-navigation-by-user-activation'></iframe><div style='width:100%!;margin-top:4px!important;text-align:right!important;'><a class='flourish-credit' href='https://public.flourish.studio/visualisation/12127894/?utm_source=embed&utm_campaign=visualisation/12127894' target='_top' style='text-decoration:none!important'><img alt='Made with Flourish' src='https://public.flourish.studio/resources/made_with_flourish.svg' style='width:105px!important;height:16px!important;border:none!important;margin:0!important;'/> </a></div>
	</body>

	</div>

);


};

export default Home;
